const Goals = ({ headerTitle, description, suggestedEntry, buttonLabel }) => { 

return (
<div>
<h2>{headerTitle}</h2>
<p>{description}</p>
<List listTitle="mygoals" placeholderText="enter goals" buttonLabel={buttonLabel} Listdescriptin={description}></List>
</div>
);
};

export default Goals;
